import "./sidebar.css";

export default function SideBar() {
  return (
    <div className="side">
      <div className="content">
        <span>
          <img className="logo" src="./assets/logo.png" alt="" />
        </span>
        <span>
          <p>eLibrary</p>
        </span>
      </div>
    </div>
  );
}
